import React from 'react';
export default class ListItem extends React.Component {
  render() {
    const allItems = this.props.AddIteme.map(function(task, index) {
      return <ListItem taskName={task} key={index} />;
    });
    return (
      <div> 
      <p>{this.props.taskName}</p>
      {allItems}
      </div>
    );
  }
}
